import React, { Component } from "react";

class TasksRemaining extends Component {
	render() {
		return (
			<div className="mb-2">
				{this.props.remaining} item
				{this.remainingCount() > 1 ? "s" : ""} left
			</div>
		);
	}
}

export default TasksRemaining;
